job_descript:
        职位诱惑：
        五险一金 商业保险

        职位描述：

        岗位职责： 
1、负责游戏配置管理平台的架构设计、技术选型、并推进技术规范的落地; 
2、负责开发平台框架、基础服务组件、核心组件等; 
3、负责平台的大量数据存储方案设计、数据分析，存储优化、为平台提供相关的解决方案; 

任职要求: 
1、本科及以上学历，计算机、通信等相关专业; 
2、5年产品线后台的设计和开发工作经验， 精通Python语言, 掌握常用数据结构和算法; 
3、精通Django,Celery等主流框架，深入理解框架实现原理及特性; 
4、熟练掌握MySQL、influxdb、opentsDB等常用数据库优化方案; 
5、熟悉业务架构设计理论，熟悉行业常见的架构方案; 
6、熟悉Linux操作系统下的开发、部署、维护等工作； 
7、有较强的学习能力和抽象能力，有强烈的求知欲、好奇心、责任心和进取心, 能及时关注和学习业界最新的技术，并且有良好的客户服务意识; 

加分项： 
1、有DevOps产品架构设计经验者优先考虑; 
2、有Golang开发经验的优先考虑； 
3、掌握常见场景设计优先，如消息队列、缓存、高并发、高可用、高负载等。


                工作地址

                                                杭州 -
                    西湖区 -
                    翠苑
                                            - 天堂软件园
